const NotFound = () => {
  return (
    <header className="container">
      <div className="row justify-content-center mt-3 mb-4">
        <div className="col-8">
      <h1 className="text-danger">
     Page Not Found
      </h1>
      </div>
      </div>
    </header>
  );
};

export default NotFound;
